import {App} from "./App";
import {BrowserRouter} from "react-router-dom";
import ReactDOM from "react-dom";
// import store from "./app/store";
import {Provider} from "react-redux";
import "./App.scss";

const appElement = document.getElementById("root");

ReactDOM.render(
  <Provider>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </Provider>,
  appElement
);
